{"about": "As a Software Product Manager at Chick-fil-A, I apply my BS in Computer Science and my skills in product planning and software development to create and improve digital solutions that enhance the customer experience and drive business growth. I work with cross-functional teams to define the product vision, roadmap, and features, and oversee the development, testing, and deployment of software products. I also monitor and analyze the product performance, user feedback, and market trends to identify and prioritize opportunities for improvement and innovation.

In addition to my role at Chick-fil-A, I am also the Founder and CEO of a stealth startup that leverages machine learning and NLP. I oversee the technical and operational aspects of the startup, including the design, development, and maintenance of the machine learning models, algorithms, and systems, as well as the business strategy, marketing, and partnerships. I have completed multiple Coursera certifications in supervised, unsupervised, and reinforcement learning, and have a strong passion for applying artificial intelligence to solve real-world problems and create value for customers and stakeholders.

