{"about": "I am Leyan Pan, a first-year Ph.D. student at the Georgia Institute of Technology advised by Prof. Wenke Lee. My research interests lie mainly in the theory and application of Machine Learning and Large Language Models in different fields, especially Computer Security. My current research interest is mainly focused on understanding the reasoning capabilities of Large Language Models and applying such capabilities in security-related applications such as program analysis.

